.side_banner_custom label{
	display:none;
	background:#FFF;
	border:3px solid #777;
	border-radius:100px;
	box-shadow:1px 1px 2px #777;
	color:#333;
	font-weight:bold;
	width:22px;
	padding:2px 0 0 2px;
	height:22px;
	line-height:22px;
	font-size:16px;
	text-align:center;
	cursor:pointer;
	position:absolute;
	right:15px;
	z-index:20001;
}

.side_banner_custom .contents,
.side_banner_custom input{
	display: none;
}
.side_banner_custom input:not(:checked) ~ .contents,
.side_banner_custom input:not(:checked) + label {
	display:block;
}
.side_banner_custom input:checked ~ .contents,
.side_banner_custom input:checked + label{
	display:none;
}


