　容量：2オンス（60ml）<br>
作品に光沢を出したり、汚れから守ってくれる仕上げに用いられるニスです。<br><br>
水性で非常に強い表面になります。
適度な光沢感を表現できます。
やわらかい筆で泡立たないように塗ってください。 
<br><br>
2オンス、8オンス、16オンスがあります。<br>

