　入り数: 100ml<br><br>非常に光沢のある仕上がりとなる水溶性仕上げ剤。<br>
固くアイボリーがかった色に仕上がります。<br>
すばやく乾燥する（約20～30分）ので、初めての方でも簡単にスムーズに塗ることができる扱いやすい溶剤です。<br>
水で薄めることも可能です。<br>
塗り重ねに向きますが、箔の上塗りには適しません。<br>
<br>（ご使用の際の注意点）<br>・塗る前に良くかき混ぜて下さい。<br>・1回のコートは、20～30分くらいで乾きます。<br>・縦、横の方向に交互にブラシで塗って下さい。<br>・5、6回ごとに良く乾かして、水、サンドを掛け表面をスムーズにして下さい。<br>・ブラシ、道具類はぬるま湯の石けん水で洗えます。<br><b>*DM便配送不可</b><br><br><img src="https://image.rakuten.co.jp/tukurutanosimi/cabinet/mail_ng.jpg" ><style type="text/css">
